import { Container } from "react-bootstrap";
import "./Home.css";
function Home() {
  return (
    <Container>
      <div style={{ backgroundColor: "#f7ede3" }} className="p-3">
        <p>Hello</p>
        <p>Hello</p>
        <p>Hello</p>
        <p>Hello</p>
        <p>Hello</p>
      </div>
    </Container>
  );
}

export default Home;
